import React, { useEffect, useState } from 'react';
import { getOrdenes, getOrdenesDeleted, postDeleteOrden, postRecoverOrden } from "../../Utils/Orden";

import { getVehiculosDeleted, postRecoverVehiculo } from "../../Utils/Vehiculo";
import RecoverTable from '../Partials/RecoverTable';

export default function OrdenTablaEliminados(props) {
    const { table } = props;
    return (
        <RecoverTable
            fetchGet={getVehiculosDeleted}
            recoverFetch={postRecoverVehiculo}
            table={[
                { column: "Patente", filter: ["patente"], row: ["patente"] },
                { column: "Año", filter: ["año"], row: ["año"] },
                { column: "Modelo", filter: ["modelo", "nombre"], row: ["modelo", "nombre"] },
                { column: "Marca", filter: ["modelo", "marca", "nombre"], row: ["modelo", "marca", "nombre"] },
                { column: "Cliente nombre", filter: ["cliente", "nombre"], row: ["cliente", "nombre"] },
                { column: "Cliente apellido", filter: ["cliente", "apellido"], row: ["cliente", "apellido"] }]}
            changeFrame={props.changeFrame}
            id="patente"
            vocabulary={{
                singular: "vehiculo",
                id: ["patente"],
                pronombre: "el"
            }}
        />
    )
};
